`,H.jsxs(t.p,{children:["According to the ",H.jsx(t.a,{href:"https://github.com/polkadot-fellows/manifesto/blob/0c3df46d76625980b8b48742cb86f4d8fa6dda8d/manifesto.pdf",children:"Fellowship Manifesto"}),", members of the Polkadot Fellowship are responsible for expertise in the strict description(s) and/or implementation(s) of these areas of contribution:"]}),`
